import "./App.css";
import TaskBox from "./components/reusables/cards/TaskBox";

function App() {
  return (
    <div>
      <TaskBox heading="Pending" bgcolor="grey"/>
      <TaskBox heading="In Progress" bgcolor="yellow"/>
      <TaskBox heading="Completed" bgcolor="green"/>
      <TaskBox heading="Deployed" bgcolor="red"/>
      <TaskBox heading="Deffered" bgcolor="red"/>
    </div>
  );
}

export default App;
